import React, {Component } from "react";
import axios from 'axios'


class Home extends Component{

    componentDidMount(){
        axios.get('http://localhost:3001/api')
        .then(result=> {
            console.log(result);
        })
        .catch(console.log())
    }


    Render(){
        return(
            <h1>Hola</h1>
        )
    }
}
